                formReference.querySelector('.wt-multiple--button span').innerHTML = tmpl;
                formReference.querySelector('.wt-multiple--button').setAttribute('title', $wt.filterHtml(tmpl));
                formReference.querySelector('legend').innerHTML = tmpl
